import React, { useState } from "react";

function PacketDetection() {
  const [images, setImages] = useState([]);
  const [previews, setPreviews] = useState([]);
  const [results, setResults] = useState([]);

  const handleImageChange = (e) => {
    const files = Array.from(e.target.files);
    setImages(files);
    setPreviews(files.map((file) => URL.createObjectURL(file)));
    setResults([]);  // Reset results on new image selection
  };

  const handleUpload = async () => {
    const formData = new FormData();
    images.forEach((image) => formData.append("images", image));

    const res = await fetch("http://localhost:5000/packet-upload-multiple", {
      method: "POST",
      body: formData,
    });

    const data = await res.json();

    if (data.results) {
      setResults(data.results);
    }
  };

  return (
    <div className="container mt-4">
      <h2 className="mb-4 text-center">ðŸ“¦ Packet Detection (Multi-image)</h2>

      <div className="mb-3">
        <input
          type="file"
          multiple
          accept="image/*"
          onChange={handleImageChange}
          className="form-control"
        />
      </div>

      {previews.length > 0 && (
        <div className="mb-4">
          <h5>Selected Images:</h5>
          <div className="d-flex flex-wrap gap-3">
            {previews.map((src, i) => (
              <img
                key={i}
                src={src}
                alt={`Preview ${i}`}
                height={150}
                className="rounded shadow"
              />
            ))}
          </div>

          <div className="mt-3">
            <button className="btn btn-primary" onClick={handleUpload}>
              ðŸš€ Upload & Detect
            </button>
          </div>
        </div>
      )}

      {results.length > 0 && (
        <div className="mt-5">
          <h4 className="text-success">Detection Results:</h4>
          <div className="row">
            {results.map((product, i) => {
              return (
                <div key={i} className="col-md-6 mb-4">
                  <div className="card shadow">
                    <h5 className="card-header">{product.product_name}</h5>
                    <div className="card-body">
                      {product.images.map((image, idx) => (
                        <div key={idx} className="mb-3">
                          <img
                            src={image.result_url}
                            alt={`Result Image ${idx}`}
                            className="card-img-top"
                            style={{ height: "200px", objectFit: "contain" }}
                          />
                        </div>
                      ))}
                      <h6 className="card-title">OCR Text:</h6>
                      <p className="card-text">{product.ocr_texts.join("\n") || "N/A"}</p>

                      <h6>Extracted Info:</h6>
                      <pre style={{ whiteSpace: "pre-wrap", fontFamily: "monospace" }}>
                        {product.extracted_info.map((info, idx) => (
                          <div key={idx}>
                            Ingredient: {info.ingredient || "null"}<br />
                            Total Weight: {info.total_weight || "null"}<br />
                            Expiry Date: {info.expiry_date || "null"}<br />
                            <br />
                          </div>
                        ))}
                      </pre>
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      )}
    </div>
  );
}

function safeJSONParse(str) {
  try {
    return JSON.parse(str);
  } catch (e) {
    return null;
  }
}

export default PacketDetection;
